-- ----------------------------
--  Table structure for `orders`
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `username` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `account_id` int(11) DEFAULT NULL,
  `account_username` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `broker_id` int(11) NOT NULL,
  `broker_username` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `client_order_id` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `status` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL,
  `symbol` varchar(12) COLLATE utf8mb4_unicode_ci NOT NULL,
  `side` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL,
  `type` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL,
  `time_in_force` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL,
  `price` bigint(20) NOT NULL,
  `order_qty` bigint(20) NOT NULL,
  `cum_qty` bigint(20) NOT NULL,
  `leaves_qty` int(11) NOT NULL,
  `created` datetime NOT NULL,
  `last_price` bigint(20) NOT NULL,
  `last_qty` bigint(20) NOT NULL,
  `average_price` bigint(20) NOT NULL,
  `cxl_qty` bigint(20) NOT NULL,
  `fee` int(11) NOT NULL,
  `fee_account_id` int(11) NOT NULL,
  `fee_account_username` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `fwd_fees` text COLLATE utf8mb4_unicode_ci,
  `email_lang` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `has_leaves_qty` tinyint(1) DEFAULT NULL,
  `has_cum_qty` tinyint(1) DEFAULT NULL,
  `has_cxl_qty` tinyint(1) DEFAULT NULL,
  `is_from_market_maker` tinyint(1) DEFAULT NULL,
  `gui_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `broker_id` (`broker_id`),
  KEY `fee_account_id` (`fee_account_id`),
  KEY `idx_orders_account_id_client_order_id` (`account_id`,`client_order_id`),
  KEY `idx_orders_account_id_created` (`account_id`,`created`),
  KEY `idx_orders_account_id_cum_qty` (`account_id`,`has_cum_qty`,`created`),
  KEY `idx_orders_account_id_cxl_qty` (`account_id`,`has_cxl_qty`,`created`),
  KEY `idx_orders_account_id_leaves_qty` (`account_id`,`has_leaves_qty`,`created`),
  KEY `idx_orders_user_id_client_order_id` (`user_id`,`client_order_id`),
  KEY `idx_orders_user_id_cum_qty` (`user_id`,`has_cum_qty`,`created`),
  KEY `idx_orders_user_id_cxl_qty` (`user_id`,`has_cxl_qty`,`created`),
  KEY `idx_orders_user_id_leaves_qty` (`user_id`,`has_leaves_qty`,`created`),
  KEY `ix_orders_account_username` (`account_username`),
  KEY `ix_orders_client_order_id` (`client_order_id`),
  KEY `ix_orders_created` (`created`),
  KEY `ix_orders_has_cum_qty` (`has_cum_qty`),
  KEY `ix_orders_has_cxl_qty` (`has_cxl_qty`),
  KEY `ix_orders_has_leaves_qty` (`has_leaves_qty`),
  KEY `ix_orders_status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=1055 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

