-- ----------------------------
--  Table structure for `position`
-- ----------------------------
DROP TABLE IF EXISTS `position`;
CREATE TABLE `position` (
  `id` int(11) NOT NULL,
  `account_id` int(11) NOT NULL,
  `account_name` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `broker_id` int(11) NOT NULL,
  `broker_name` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `currency` varchar(4) COLLATE utf8mb4_unicode_ci NOT NULL,
  `position` int(11) NOT NULL,
  `last_update` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `_position_uc` (`account_id`,`broker_id`,`currency`),
  KEY `broker_id` (`broker_id`),
  KEY `currency` (`currency`),
  CONSTRAINT `position_ibfk_1` FOREIGN KEY (`account_id`) REFERENCES `users` (`id`),
  CONSTRAINT `position_ibfk_2` FOREIGN KEY (`broker_id`) REFERENCES `users` (`id`),
  CONSTRAINT `position_ibfk_3` FOREIGN KEY (`currency`) REFERENCES `currencies` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
--  Table structure for `position_ledger`
-- ----------------------------
DROP TABLE IF EXISTS `position_ledger`;
CREATE TABLE `position_ledger` (
  `id` int(11) NOT NULL,
  `currency` varchar(4) COLLATE utf8mb4_unicode_ci NOT NULL,
  `account_id` int(11) NOT NULL,
  `account_name` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `broker_id` int(11) NOT NULL,
  `broker_name` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `payee_id` int(11) NOT NULL,
  `payee_name` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `payee_broker_id` int(11) NOT NULL,
  `payee_broker_name` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `operation` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL,
  `amount` bigint(20) NOT NULL,
  `position` int(11) NOT NULL,
  `reference` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created` datetime NOT NULL,
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `currency` (`currency`),
  KEY `account_id` (`account_id`),
  KEY `broker_id` (`broker_id`),
  KEY `payee_id` (`payee_id`),
  KEY `payee_broker_id` (`payee_broker_id`),
  CONSTRAINT `position_ledger_ibfk_1` FOREIGN KEY (`currency`) REFERENCES `currencies` (`code`),
  CONSTRAINT `position_ledger_ibfk_2` FOREIGN KEY (`account_id`) REFERENCES `users` (`id`),
  CONSTRAINT `position_ledger_ibfk_3` FOREIGN KEY (`broker_id`) REFERENCES `users` (`id`),
  CONSTRAINT `position_ledger_ibfk_4` FOREIGN KEY (`payee_id`) REFERENCES `users` (`id`),
  CONSTRAINT `position_ledger_ibfk_5` FOREIGN KEY (`payee_broker_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
--  Table structure for `trade`
-- ----------------------------
DROP TABLE IF EXISTS `trade`;
CREATE TABLE `trade` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL,
  `counter_order_id` int(11) DEFAULT NULL,
  `buyer_id` int(11) NOT NULL,
  `seller_id` int(11) NOT NULL,
  `buyer_username` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `seller_username` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL,
  `side` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL,
  `symbol` varchar(12) COLLATE utf8mb4_unicode_ci NOT NULL,
  `size` bigint(20) NOT NULL,
  `price` bigint(20) NOT NULL,
  `created` datetime NOT NULL,
  `trade_type` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `counter_order_id` (`counter_order_id`),
  KEY `ix_trade_created` (`created`),
  KEY `ix_trade_symbol` (`symbol`)
) ENGINE=InnoDB AUTO_INCREMENT=802 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

